        // Base styling for all countries
        function baseStyle(feature) {
            return {
                weight: 2,
                opacity: 1,
                color: 'white',
                dashArray: '3',
                fillOpacity: 0.7,
                fillColor: '#50000'
            };
	    }

        // Highlight the country
        function highlightFeature(e) {
            const layer = e.target;

            layer.setStyle({
                weight: 5,
                color: '#666',
                dashArray: '',
                fillOpacity: 0.7
            });

            layer.bringToFront();
        }

        // Resets the highlight
        function resetHighlight(e) {
		    Netherlands.resetStyle(e.target),
            Germany.resetStyle(e.target),
            Brittain.resetStyle(e.target),
            Turkey.resetStyle(e.target);
	    }

        // Highlight and reset highlight functions
        // Unique URL for country
        function NetherlandsOnEachFeature(feature, layer) {
            layer.on({
                mouseover: highlightFeature,
			    mouseout: resetHighlight,
                click: function(e){
                    window.location = "https://www.holland.com/be_nl/toerisme";
                }
            })
        }

        // Highlight and reset highlight functions
        // Unique URL for country
        function GermanyOnEachFeature(feature, layer) {
            layer.on({
                mouseover: highlightFeature,
			    mouseout: resetHighlight,
                click: function(e){
                    window.location = "https://www.deutschland.de/en/travel-in-germany";
                }
            })
        }

        // Highlight and reset highlight functions
        // Unique URL for country
        function BrittainOnEachFeature(feature, layer) {
            layer.on({
                mouseover: highlightFeature,
			    mouseout: resetHighlight,
                click: function(e){
                    window.location = "https://www.visitbritain.com/en";
                }
            })
        }

        // Highlight and reset highlight functions
        // Unique URL for country
        function TurkeyOnEachFeature(feature, layer) {
            layer.on({
                mouseover: highlightFeature,
			    mouseout: resetHighlight,
                click: function(e){
                    window.location = "https://goturkiye.com/";
                }
            })
        }

        // Country data added to the map with styling and unique onEachFeature function
        var Netherlands = new L.geoJSON(Ned, {
            style: baseStyle,
            onEachFeature: NetherlandsOnEachFeature,
        });

        Netherlands.addTo(map);
        
        // Country data added to the map with styling and unique onEachFeature function
        var Germany = new L.geoJSON(Ger, {
            style: baseStyle,
            onEachFeature: GermanyOnEachFeature,
        });

        Germany.addTo(map);
        
        // Country data added to the map with styling and unique onEachFeature function
        var Brittain = new L.geoJSON(Gbr, {
            style: baseStyle,
            onEachFeature: BrittainOnEachFeature,
        });

        Brittain.addTo(map);
        
        // Country data added to the map with styling and unique onEachFeature function
        var Turkey = new L.geoJSON(Tur, {
            style: baseStyle,
            onEachFeature: TurkeyOnEachFeature,
        });

        Turkey.addTo(map);

    </script>
